CREATE PROCEDURE [dbo].[CRUDWound] 
	-- Add the parameters for the stored procedure here
	@WoundId int = 0,
	@WoundName nvarchar(30) = " ",
	@Grade nvarchar(5) = " ",
	@WoundDescription nvarchar(max) = " ",
	@Active bit = 1,
	@Command nvarchar(10) = " "
AS

BEGIN -- SET NOCOUNT ON added to prevent extra result sets from -- interfering with SELECT statements. SET NOCOUNT ON;
-- Insert statements for procedure here Select * From CareContract left outer join EndUser P on CareContract.PatientId = P.UserId left outer join Suburb on CareContract.SuburbId = Suburb.SuburbId left outer Join Wound on CareContract.WoundId = Wound.WoundId Where CareContract.Active = 1 and CareContract.NurseId = @NurseId and CareContract.ContractStatus = 'A' order by P.Lastname asc
END

BEGIN -- SET NOCOUNT ON added to prevent extra result sets from -- interfering with SELECT statements. SET NOCOUNT ON;
-- Insert statements for procedure here Select * From CareContract C left outer join Nurse n on N.NurseId = @NurseId left outer join EndUser P on C.PatientId = P.UserId left outer join Suburb S on C.SuburbId = S.SuburbId left outer join Wound W on C.WoundId = W.WoundId left outer join PrefferedSuburb PS on @NurseId in (PS.NurseId) Where C.SuburbId in (PS.SuburbId) and N.Grade = W.Grade and C.Active = 1 and C.ContractStatus = 'N'
END
